@ManalBahmishan كنا في دورة اثناء وفاة والده رحمه الله وقام بأداء رسالته رغم الاألم الظاهر على وجهه 

دائما ما يشعرنا بتعلقه بوالده نسأل الله كما علقته به بالدنيا اجمعهم في جنات الخلد

 والله علاقتي به ثلاث اشهر واني دمعت عيناي على فراقه نسأل الله ان يتغمده بواسع رحمته وعظم الله اجركم

@wfyat_md رحمك الله د. مهند اللهم اغفر له، وأكرم نزله، اللهم ثبته عند السؤال، وثقل ميزانه، ويمن كتابه، واجعل قبره روضة من رياض الجنة، وألحقه بالأنبياء والشهداء والصالحين وحسن أولئك رفيقاً.
اللهم ثبت أهله، وأجرهم في مصيبتهم، واجبر قلوبهم يا الله وارزقهم الصبر والسلوان.
عظم الله أجرنا جميعاً
